import './App.css';
import Footer from './Footer';
import Header from './Header';

function App() {
  let name = 'vinay';
  return (
    <div className="App">
    <Header />

      <header className="App-header">
        <img className="App-logo" alt="logo" />
        <p>
          Edit1 {name} <code>src/App.js</code> and save to reload.
        </p>
        <input type="text" />
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      <Footer />

      </header>
    </div>
  );
}

export default App;
